                "policy_refunds": "I GLADLY ACCEPT RETURNS\nJust contact me within: 7 days of delivery\nShip returns back to me within: 14 days of delivery\n\nI DON'T ACCEPT EXCHANGES OR CANCELLATIONS\nBut please contact me if you have any problems with your order.\n\nTHE FOLLOWING ITEMS CAN'T BE RETURNED\nBecause of the nature of these items, unless they arrive damaged or defective, I can't accept returns for:\n- Custom or personalized orders\n\nCONDITIONS OF RETURN\nBuyers are responsible for return shipping costs.\nIf the item is not returned in its original condition, the buyer is responsible for any loss in value.",
                "policy_additional": "CAN I SHIP MY ORDER DIRECTLY TO THE GIFT RECIPIENT?\nYes, I would be happy to!  Just let me know in the &quot;note to seller&quot; field that this is a gift and include the message you would like included.  Please remember to enter and select the gift recipient&#39;s address as the &quot;ship to&quot; address.  I will wrap the order in tissue paper and add a gift tag with your personalized message.\n\nWHEN WILL MY ORDER BE SHIPPED?\nEach listing includes a &quot;ready to ship&quot; time.  Since most items in the shop is made-to-order, this is the time needed to physically make the item and prepare it for shipping.  \n\nWhen you order multiple items they will be shipped together unless otherwise requested.  Please add the &quot;ready to ship&quot; times in each listing together.  I will typically not need the full allotment and will send the order as soon as everything is made.  Once shipped I will refund the difference in shipping cost.\n\nIf you need your order shipped by a specific date please contact me and I will be happy to see if I can accommodate.\n\nWHEN WILL MY ORDER ARRIVE?\nTo keep shipping rates low all orders are shipped via Canada Post in a bubble mailer or box depending on the size of your order.\n\nThe usual delivery standards as quoted from the Canada Post website:\n- Canada: 2-9 business days (local is 2, regional up to 5, national up to 9)\n- US: 5-8 business days\n- International: 6-10 business days\n\nPlease note that these delivery times are just standards and are not guaranteed by Canada Post.  If you would like your order tracked or expedited please send me a message and I will provide a quote.\n\nMAY I REQUEST A CUSTOM ORDER?\nYou can request custom colours on almost anything in the shop.  Send me a message about custom sizes and I will see if the pattern will let me accommodate.  I do not take orders on anything not listed in the shop.",
