            "title": "OneStopTieShop: Ties for Men, Tie Accessories, Wedding Tie, Tie set , Groomsmen Tie, WaterStone Floral Tie, Lapel, Blue Floral Silk Hankie",
            "description": "Regular box is $24.99 and has a value of $36!\nOur FULL SET is $34.99 and has a value of $50!A luxurious handmade set offered at an inexpensive price. If you are looking for the best bang for your buck, stop at our shop and check out our products. Made with 100% cotton, this attractive Tie Set is like no other. Be unique, and receive compliments with this set including a hand-cast brass lapel to complete the look. Save even more when you add the FULL set option to include a pair of extreme comfort cotton socks and a tie bar! Coupon Code inside the box for your next purchase or for a friend!\n\nItems Included: \n        ⁃       Luxury Slim Neck Tie (6.5cm x 140cm, 100% Cotton)\n        ⁃       Luxury Pocket Square (23cm x 23cm, 100% Cotton)\n        ⁃       Hand Cast, Silver, Brass Lapel \nFull Set:\n        -       Cotton Socks (30cm total length, 100% Cotton)\n        -       Tie Bar (Handmade Brass)\n\n*Please note Items are available individually and/or as a set* \n\nWHAT WE RECOMMEND\n- Save your hard earned money, and purchase our very affordable set, fitting for any occasion.\n- Pairs amazing with brown, black, beige or Gray suits.  \n- This Neck Tie Set can be worn throughout every season of the year or for special events such as weddings, religious events, or as everyday work attire.   \n\nWHAT IS ONESTOPTIESHOP?\nWe are an independent tie shop with one goal in mind: To accomplish exactly what our name states “One Stop Tie Shopping”. We offer inexpensive, all-inclusive Sets designed to compliment any look, so you don&#39;t have to worry about looking for matching accessories. We are up to date in trending patterns and combinations, so you&#39;re guaranteed to receive lots of compliments! We use the best materials to craft our ties, and we have a very limited supply, as we want our customers to have unique tie sets and stand out from the rest. We guarantee your satisfaction, and with such an affordable price, there is no need to shop at big retailers or other expensive shops. \n\n\nFOUNDER OF ONESTOPTIESHOP\nI created this shop as a side business. As a Family and Businessman, I understand the importance of a balanced product. We all search for a perfect luxury product that won’t break the bank. I grew weary of overpaying for ties that were just named brand, made with cheap materials. My wife and I struggled to find affordable ties and/or matching pocket squares. I could not believe there weren&#39;t great sets available that caught my eye and didn&#39;t break the bank! I decided to take matters into my own hands and so we created a shop where one can buy sets that matched perfectly and didn&#39;t look outdated or overused. We strive to be unique, affordable and offer a peace of mind like no other to customers. If I could return all the ties and hankies I overpaid for, I would, but there were no other alternatives like this shop at the time. I hope you take advantage of my shop, save yourself money, and look great doing it.",
