                "policy_additional": "- Please know that if for any reason you need to return a bodysuit\n1. You are responsible for paying for shipping back to me. \n2. It MUST have a tracking number\n3. It needs to arrive in the same box it was mailed and packaged just as we sent to you.\n4. If the items are dirty or have any smells we will refuse the refund.\nPlease understand we are a small business and we have no control on damages but we will like to make your shopping experience a good one. Thank you for complying to the above mentioned policies.\nIf you follow all of the steps above we can exchange or refund once we inspect the non-custom items.\n\nCARE INSTRUCTIONS\nTo care for your bodysuits only wash with similar colors, do not iron the vinyl because it will melt.\nFor your bodysuit to last longer do not use bleach.\n\nSHIPPING\nOur turn around time is 24 hours for bodysuits order and digital announcements.\nPlease use the tracking number we provide you and first contact your local post office.\n***Just a friendly reminder: Kalina&#39;s Creations is not responsible for lost or stolen packages. We highly recommend you send your packages to an address where someone will be available to receive them. We will help you track your packages as much as we are able. Thank you for your purchases!\n\nSIZING DETAILS\nAll our announcement Onesies come in 0-3 months. If you need a bigger size we can do up to 12 months. Please send me a message before you purchase to make sure I can provide you with the size you need. Thank you!\n\nGIFT WRAPPING AND PACKAGING\nYes! All our Onesies are placed in our signature craft box, which we gift wrap for a bigger surprise. We also add a handmade card based on the season. We wrap your gifts and you take ALL the credit :) and we love it!\n\nNEED A CUSTOM DIGITAL ANNOUNCEMENT?\nI offer custom or personalized digital announcements. Please know these take a time to create and deliver. Please, allow a minimum of 24 to 72 at least. This is like hiring a photographer to create your news for an amazing discounted price for you! Isn&#39;t that awesome?!\n\nI BOUGHT A PICTURE BUT I SAW ANOTHER I LIKE BETTER\nWe are very grateful you shop from us. However, it is our policy that once your digital order has been delivered we cannot send you a different photograph because you like another better. If you like another picture after your photograph has been completed, you will have to purchase another one. We take hours taking photographs, buying props and offering our photos ready to do your reveals. We are most grateful for your business every day, thank you :)!\n\nHOW DO I SEND YOU MY ULTRASOUND FOR MY DIGITAL ORDER?\nSend me a separate message, take a photo with your phone and attach that photo to the message and I will take care of the rest :).\n\nCAN I SEND YOU AN UPDATED ULTRASOUND FOR MY PHOTO YOU COMPLETED WEEKS AGO?\nThis does not happen too often so, my answer is based on the packaged you purchased. Please message me and I will do my best. As you can imagine, all of these little additions take time so there might be a small fee for this modification to respect my time of $3.99.\n\nWHAT IS THE NAME OF YOUR SECOND SHOP?\nOur second shop is MyBebeBlossoms.com and it open May 1st so head over there and give it some love. Expect our 5 star services and speedy deliveries :)",
