                "announcement": "CURRENT PRODUCTION TIME IS 5-7 BUSINESS DAYS BEFORE SHIPPING TIME (2-5 DAYS).  \r\n\r\nFollow on Instagram for promotions, sales and shop updates @CollectiveCreationsC \r\n\r\nFree standard shipping on all U.S. orders over $35.\r\n\r\nThank you for stopping by!  I hope you find something you love!!",
                "currency_code": "USD",
                "is_vacation": false,
                "vacation_message": "We have reached the max orders we can do in our 5 day turn around time. Shop is closed to catch up for a few days. We’ll be back open on Sunday. Follow along on Instagram @collectivecreationsc for updates. Thank you.",
                "sale_message": "Thank you so much for your purchase!\r\nHope you enjoy your items and please come again!\r\n\r\nChandra\r\nCollectiveCreationsC",
                "digital_sale_message": null,
                "last_updated_tsz": 1570660237,
                "listing_active_count": 269,
                "digital_listing_count": 0,
                "login_name": "CollectiveCreationsC",
                "accepts_custom_requests": false,
                "policy_welcome": "PLEASE ALWAYS READ ALL ITEM DETAILS-DESCRIPTION BEFORE PURCHASING.\r\nWelcome to CollectiveCreationsC! Follow me on Instagram (@collectivecreationsc) or Facebook (Collectivecreationsc) for pics and shop announcements!! I hope you find something you love!",
                "policy_payment": "Orders will not be sent out until I receive confirmation of payment.  If you need to cancel or make changes to an order, please contact me immediately. Orders may not be cancelled or changed after 24 hours of placing the order.\r\n\r\nBecause of the nature of handmade products, ALL SALES ARE FINAL, unless there is a mistake on my part.  Thanks for understanding.\r\n\r\nUtah Residents will be charged a 6.05% Sales Tax Rate.  ",
                "policy_shipping": "Items will ship out after my production time of up to 5-7 business days.  (DOES NOT INCLUDE SATURDAY/SUNDAY/HOLIDAYS) \r\n\r\nI ship all of my items USPS first class mail which USUALLY takes 3-5 days.  If you need something sooner, shipping can be upgraded to Priority (1-3days) for an additional cost. \r\n\r\nDO NOT LEAVE A NOTE ON YOUR ORDER TELLING ME YOU NEED IT BY A CERTAIN DATE!! I don’t see these messages until I get to your order sometimes days after the order is placed. Write me in Etsy’s convo’s FIRST if you need something by a certain date to see if it’s possible! I am only responsible for shipping it within the time frame I have listed and what it tells you at checkout. \n\nINTERNATIONAL BUYERS BEWARE!!  PURCHASE AT YOUR OWN RISK.  I AM NOT RESPONSIBLE FOR YOUR PACKAGE ONCE SHIPPED.  Most packages have been getting to their destination in about 10 days (after it ships) but please allow up to 2-3 weeks to your specific country.  Please note that any Customs/Duties fees or VAT (value added tax) are the responsibility of the buyer.  \r\n\r\nTO ALL BUYERS: Once a package is sent in the mail, I am not responsible for lost or stolen items during shipping. I do not purchase insurance on my items, if you would like to please message me for an additional cost.  All U.S. orders have free tracking.\r\n\r\nPLEASE make sure to check your shipping address listed before purchasing, including PAYPAL.  I&#39;m not responsible for incorrect addressing! I SEND OUT EVERYTHING ASAP, sometimes the next morning so PLEASE PLEASE Double check your ADDRESS!!",
                "policy_refunds": "Because of the nature of handmade products, ALL SALES ARE FINAL, unless there is a mistake on my part.  Thanks for understanding. \r\n\r\nI EXPECT ALL MY CUSTOMERS TO READ THE ENTIRE ITEM &quot;DETAILS&quot; AND DESCRIPTIONS BEFORE PURCHASING.  THIS INCLUDES THE SIZE OF BOW. I LIST THE DIMENSIONS ON EVERY BOW. I AM NOT RESPONSIBLE IF THE BOW IS NOT THE SIZE YOU WERE EXPECTING. MEASURE BEFORE ORDERING.  I PUT ALL IMPORTANT INFORMATION IN EACH LISTING.\r\n\r\n All my headbands are a “one size” stretchy nylon band that will fit from newborn to toddler and beyond. You can also attach each bow to an alligator clip, as well. \n\nRefunds or exchanges are not allowed for failure to read descriptions, etc. Also each monitor/screen may have different color outputs. I do my best to accurately portray the color according to my device but be advised colors may be slightly different.\n\nI do aim to please, though, and if for any other reason you are not satisfied, please message me to see what I can do. Thank you!",
