                "title": "Handmade & Vintage by Jennifer",
                "announcement": "Follow me on Instagram @FallingCoconuts for previews and other fun finds!  :) \r\n\r\nHandmade Goodies, Vintage, and supplies - you never know what you will find at Falling Coconuts! Take your time shopping, and don&#39;t hesitate to contact me if you don&#39;t see the exact item you are looking for or have questions.  I am always willing to do the best I can to make or find what you may be looking for!",
                "currency_code": "USD",
                "is_vacation": false,
                "vacation_message": "Art Fair today!!  Will be open later tonight!! :) \r\n\r\nHIGH QUALITY Handmade goods & Vintage Finds! \r\n\r\nWhile I am on vacation - please visit my profile for a fun story about where my shop name &quot;Falling Coconuts&quot; originated!    \r\n\r\n~ Jennifer",
                "sale_message": "Thank you so much for purchasing from Falling Coconuts!I hope you have found something that is &quot;just what you were looking for&quot; - whether it is for you or to gift for someone else.  \r\n\r\nPlease check back often as I will adding new listings regularly. \r\n\r\nThanks You!\r\nJennifer",
                "digital_sale_message": null,
                "last_updated_tsz": 1570660259,
                "listing_active_count": 273,
                "digital_listing_count": 0,
                "login_name": "FallingCoconuts",
                "accepts_custom_requests": false,
                "policy_welcome": "Welcome to Falling Coconuts - a shop that contains treasures of all kinds. \r\n\r\nI hand make all the items that are listed in my shop (I make the cards, take the photography, do all the sewing, tie the knots, cut all the fabric etc.) except for the vintage goods - those I wash, iron, or clean as needed.  \r\n\r\nI try to describe all listings as best as I can, but please remember that the colors may vary depending on your computer and monitor settings.  All pictures in the listings are of the product you will receive (I do not use stock photos unless noted on the photo).  Items are made in a smoke free home.\r\n\r\nIf you are interested in International shipping please contact me with your location and I will get you a quote for shipping charges.  \r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\nFacebook - Falling Coconuts Fan Page! \r\nhttp://www.facebook.com/pages/Falling-Coconuts/197162066814\r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\nPlease be sure to read my shop policies or contact me with questions.\r\n\r\nThank you for looking and if there is anything I can help you with please feel free to contact me via Etsy.  \r\n\r\nJennifer",
                "policy_payment": "I accept both PayPal and Direct Checkout. \r\n\r\nIf you’re new to Etsy, here’s a helpful tutorial about the checkout process: \r\n\r\nhttp://www.etsy.com/help_guide_checkout.php",
                "policy_shipping": "All items will be shipped within 2-3 business days of receipt of payment.  Most items are shipped via USPS First Class Mail, but some may be shipped via Priority Mail.  If you are interested in upgraded shipping please contact me before purchasing so I can adjust the shipping charges.  Books/Journals will be mailed via Media Mail...but if you would like priority shipping please send me a note prior to your purchase so I can adjust the shipping options to reflect the appropriate charges.  \r\n\r\nHoliday shipping:  I will try my hardest to get your orders to the post office as quickly as possible, but I cannot guarantee that your order will arrive before your specified holiday.  If you would like faster shipping option please send me a note prior to your purchase so we can coordinate your shipping request with the appropriate shipping charges.  \r\n\r\nI am not responsible for lost or damaged packages (I try my hardest to package all of my items in a way that ensures safe mailing though).   \r\n\r\nIf you are interested in International shipping please contact me with your location and I will get you a quote for shipping charges.",
                "policy_refunds": "There are NO REFUNDS and I am not responsible for items lost or damaged in the mail. \r\n\r\nI try to package all items to ensure safe delivery. If you have a question or concern please contact me and we can go from there.",
                "policy_additional": "If you are interested in custom or bulk orders please contact me through Etsy prior to making a purchase.  I try to keep my prices at a reasonable price for all customers, so I am unable to offer wholesale pricing at this time.  If you are interested in a custom order of a large quantity contact me for pricing.  \r\n\r\nThank You!",
